INSERT INTO `documento` (`id`, `texto`) VALUES
(1, 'Tendo sido levados pelo Espírito Santo a aceitar a Jesus Cristo como único e suficiente Salvador, e batizados, sob profissão de fé, em nome do Pai, do Filho e do Espírito Santo, decidimo-nos, unânimes, como um corpo em Cristo, firmar, solene e alegremente, na presença de Deus e desta congregação, o seguinte Pacto: Comprometemo-nos a, auxiliados pelo Espírito Santo, andar sempre unidos no amor cristão; trabalhar para que esta igreja cresça no conhecimento da Palavra, na santidade, no conforto mútuo e na espiritualidade; manter os seus cultos, suas doutrinas, suas ordenanças e sua disciplina; contribuir liberalmente para o sustento do ministério, para as despesas da igreja, para o auxílio dos pobres e para a propaganda do evangelho em todas as nações.Comprometemo-nos, também, a manter uma devoção particular; a evitar e condenar todos os vícios; a educar religiosamente nossos filhos;  a procurar a salvação de todo o mundo, a começar dos nossos parentes, amigos e conhecidos; a ser corretos em nossas transações, fiéis em nossos compromissos, exemplares em nossa conduta e ser diligentes nos trabalhos seculares; evitar a detração, a difamação e a ira, sempre e em tudo visando à expansão do reino do nosso Salvador.          Além disso, comprometemo-nos a ter cuidado uns dos outros; a lembrarmo-nos uns dos outros nas orações; ajudar mutuamente nas enfermidades e necessidades; cultivar relações francas e a delicadeza no trato; estar prontos a perdoar as ofensas, buscando, quando possível, a paz com todos os homens.    Finalmente, nos comprometemos a, quando sairmos desta localidade para outra, nos unirmos a uma outra igreja da mesma fé e ordem, em que possamos observar os princípios da Palavra de Deus e o espírito deste Pacto.    O Senhor nos abençoe e nos proteja para que sejamos fiéis e sinceros até a morte');

