INSERT INTO `versiculos` (`id`, `versiculo`) VALUES
(1, '\"Porque Deus tanto amou o mundo que deu o seu Filho Unigênito, para que todo o que nele crer não pereça, mas tenha a vida eterna. João3:16'),
(2, 'Respondeu Jesus: \"Eu sou o caminho, a verdade e a vida. Ninguém vem ao Pai, a não ser por mim. João 4:6'),
(3, 'Por isso não tema, pois estou com você; não tenha medo, pois sou o seu Deus. Eu o fortalecerei e o ajudarei; eu o segurarei com a minha mão direita vitoriosa. Isaías 41:10'),
(4, 'Não fui eu que ordenei a você? Seja forte e corajoso! Não se apavore nem desanime, pois o Senhor, o seu Deus, estará com você por onde você andar\". Josué 1:9'),
(5, 'Busquem, pois, em primeiro lugar o Reino de Deus e a sua justiça, e todas essas coisas serão acrescentadas a vocês. Mateus 6:33'),
(6, 'Não se amoldem ao padrão deste mundo, mas transformem-se pela renovação da sua mente, para que sejam capazes de experimentar e comprovar a boa, agradável e perfeita vontade de Deus.  Romanos 12:2'),
(7, 'Pois o salário do pecado é a morte, mas o dom gratuito de Deus é a vida eterna em Cristo Jesus, nosso Senhor. Romanos 6:23'),
(8, 'E conhecerão a verdade, e a verdade os libertará\". João 8:32'),
(9, '\"Venham a mim, todos os que estão cansados e sobrecarregados, e eu darei descanso a vocês. Mateus 11:28'),
(10, 'Nunca adore nenhum outro deus, porque o Senhor, cujo nome é Zeloso, é de fato Deus zeloso. Ex 34:14'),
(11, 'Sabemos que Deus age em todas as coisas para o bem daqueles que o amam, dos que foram chamados de acordo com o seu propósito. Romanos 8:28'),
(12, 'O ladrão vem apenas para roubar, matar e destruir; eu vim para que tenham vida e a tenham plenamente. João 10:10'),
(13, 'Entregue o seu caminho ao Senhor; confie nele, e ele agirá:  Salmos 37:5'),
(14, 'Pois todos pecaram e estão destituídos da glória de Deus, Romanos 3:23'),
(15, 'Porque sou eu que conheço os planos que tenho para vocês\', diz o Senhor, planos de fazê-los prosperar e não de causar dano, planos de dar a vocês esperança e um futuro. Jeremias 29:11'),
(16, '\"Eu disse essas coisas para que em mim vocês tenham paz. Neste mundo vocês terão aflições; contudo, tenham ânimo! Eu venci o mundo\". João 16:33'),
(17, 'Tudo posso naquele que me fortalece. Filipenses 4:13'),
(18, 'Portanto, vão e façam discípulos de todas as nações, batizando-os em nome do Pai e do Filho e do Espírito Santo, Mateus 28:19'),
(19, 'Se confessarmos os nossos pecados, ele é fiel e justo para perdoar os nossos pecados e nos purificar de toda injustiça. 1 João 1:9'),
(20, 'Contudo, aos que o receberam, aos que creram em seu nome, deu-lhes o direito de se tornarem filhos de Deus, João 1:12'),
(21, 'A tua palavra é lâmpada que ilumina os meus passos e luz que clareia o meu caminho.  Salmos 119:105'),
(22, 'E disse-lhes: \"Vão pelo mundo todo e preguem o evangelho a todas as pessoas. Marcos 16:15'),
(23, 'Mas o fruto do Espírito é amor, alegria, paz, paciência, amabilidade, bondade, fidelidade, Gálatas 5:22'),
(24, 'Ora, a fé é a certeza daquilo que esperamos e a prova das coisas que não vemos. Hebreus 11:1'),
(25, 'Portanto, se alguém está em Cristo, é nova criação. As coisas antigas já passaram; eis que surgiram coisas novas! 2 Coríntios 5:17'),
(26, 'Mas receberão poder quando o Espírito Santo descer sobre vocês, e serão minhas testemunhas em Jerusalém, em toda a Judeia e Samaria, e até os confins da terra\". Atos dos Apóstolos 1:8'),
(27, 'Pois a palavra de Deus é viva e eficaz, e mais afiada que qualquer espada de dois gumes; ela penetra até o ponto de dividir alma e espírito, juntas e medulas, e julga os pensamentos e as intenções do coração.  Hebreus 4:12'),
(28, 'Toda a Escritura é inspirada por Deus e útil para o ensino, para a repreensão, para a correção e para a instrução na justiça,  2 Timóteo 3:16'),
(29, 'Espere no Senhor. Seja forte! Coragem! Espere no Senhor.  Salmos 27:14'),
(30, 'Clame a mim e eu responderei e direi a você coisas grandiosas e insondáveis que você não conhece\".  Jeremias 33:3');
